var $programs=$("#programs .article");
var numPrograms=$programs.length;
var programsWidth=(numPrograms*583);$("#programs").css({'width':programsWidth});

$("#slider_position ol").css({'width':(numPrograms * 25)});

currentProgram=1;
$("#program_slider .article:first-child").addClass('active');
$("#slider_position li:first-child").addClass("active");
if(numPrograms>1)
{
	$("#next_program").removeClass('inactive').addClass('active');
}
$("#next_program").click(function(){
	if($(this).hasClass('active'))
	{
	var newPosition=(currentProgram*-583);
	currentProgram=currentProgram+1;
		if(currentProgram>1)
		{
			$("#prev_program").removeClass('inactive').addClass('active');
		}
		if((currentProgram>1)&&(currentProgram<numPrograms))
		{
			$("#next_program").removeClass('inactive').addClass('active');
			$("prev_program").removeClass('inactive').addClass('active');
		}
		if(currentProgram==numPrograms)
		{
			$(this).removeClass('active').addClass('inactive');
		}
		$("#programs").animate({'left':newPosition},750);
	}
	
	$("#slider_position ol li").removeClass('active');
	$("#slider_position ol li").eq(currentProgram - 1).addClass('active');

	return false;
});
$("#prev_program").click(function(){
	if($(this).hasClass('active'))
	{
		var newPosition=((currentProgram-1)*-583)+583;
		currentProgram=currentProgram-1;
		if(currentProgram==1)
		{
			$(this).removeClass('active').addClass('inactive');
		}
		if((currentProgram>1)&&(currentProgram<numPrograms))
		{
			$("#next_program").removeClass('inactive').addClass('active');
			$("#prev_program").removeClass('inactive').addClass('active');
		}
		if(currentProgram==numPrograms)
		{
			$("#next_program").removeClass('active').addClass('inactive');
		}
		$("#programs").animate({'left':newPosition},750);
	}
	$("#slider_position ol li").removeClass('active');
	$("#slider_position ol li").eq(currentProgram - 1).addClass('active');

	return false;
});
